function Message1(props){
    return(
        <div>
            firstname:{props.fname}<br/>
            lastname:{props.lname}<br/>
            mail:{props.mail}<br/>
            password:{props.password}<br/>
        </div>
    
    )
}
function message(){
    return(
        <div>
            <Message1 fname="hari" lname="munireddy" mail="munireddy.m@gmail.com" password="hello@123"/>
        </div>
    )
}
export default message;
